svg.script:
var n;
var m;
//Añadir función en la carga del display principal
webMI.addOnload(function(e) {

	//Obtener el nombre en formato string del objeto base, haciendo una query al webMI 
	var name = webMI.query.base;
	//Parte de la función addOnload
	var id = "";
	var value = true;




//Cargar menús de equipamiento, alarmas y energía
webMI.display.openDisplay("SYSTEM.DISPLAYS.Circuito.Equipos",
	{base:  name},
	"equipment");

webMI.display.openDisplay("SYSTEM.DISPLAYS.Circuito.Energia",
	{base:  name},
	"energy");

webMI.display.openDisplay("SYSTEM.DISPLAYS.Circuito.Alarmas",
	{base:  name},
	"alarming");

webMI.data.subscribe(webMI.query["base"] + ".circuito", function(e) {
	var id = "id_36";
	var value = e.value;
	webMI.display.openDisplay(value, webMI.query, "topo");
	});	


});
